.CODE
MAIN PROC FAR
    MOV AX , @DATA
    MOV DS , AX
;---------- Graphics Mode configuration ---------;
	mov ax, 4F02h 
	mov bx, 0100h	
	INT 10h      	;execute the configuration
;--------- if these configurations executed twice else where in the code all previous drawings will be lost ------; 
    call DrawPlayerOne
    call DrawPlayerTwo    
	;--------- Wait for testing ----------
	;testing:mov ah, 07h   ;Input from keyboard without echo to the screen
	;int 21h
    ;call ShootPlayerTwo
   ; jmp testing
testing:
mov ah,1
int 16h

cmp ah,1eh              ; if letter 'a' not pressed
jne nextComp            ; next comparison
call ShootPlayerTwo

nextComp:
cmp ah,1ch               ; if enter key pressed
jne testing
call ShootPlayerOne

jmp testing


MAIN ENDP	
;-------- Player one will shoot player two --------;
ShootPlayerTwo PROC
    mov bx,bulletOneXPosition    ;save the original value after shootting 
    mov reset,bx
    movebullet:
        Call DrawPlayerOneBullet
        ;Delay
        ;Clear Previous shot
        mov clearbulletone,1
        call DrawPlayerOneBullet
        mov clearbulletone,0
        ;---------------------
        ADD bulletOneXPosition,10        
        CMP bulletOneXPosition,455
        JNZ movebullet      	   
        ;---------Reset the start position-----
        mov bx,reset
        mov bulletOneXPosition,bx
    RET
ShootPlayerTwo ENDP   
;-------- Player two will shoot player one --------;
ShootPlayerOne PROC
    mov bx,bulletTwoXPosition   ;save the original value after shootting 
    mov reset,bx
    movebullet2:
        Call DrawPlayerTwoBullet
        ;Delay
        ;Clear Previous shot
        mov clearbulletone,1
        call DrawPlayerTwoBullet
        mov clearbulletone,0
        ;---------------------
        SUB bulletTwoXPosition,10        
        CMP bulletTwoXPosition,140
        JNZ movebullet2      	   
        ;---------Reset the start position-----
        mov bx,reset
        mov bulletTwoXPosition,bx
    RET
ShootPlayerOne ENDP   
DrawPlayerOneBullet PROC 
	       ;mov ax, 4F02h    ;
	       ;mov bx, 0100h    ; 640x400 screen graphics mode
	       ;INT 10h      	;execute the configuration
	       MOV AH,0Bh   	;set the configuration
	       MOV CX, bulletOneXPosition  	;set the start drawing point 
	       ADD CX, bulletimgW  	;set the width (X) up to 64 (based on image resolution)
	       MOV DX, bulletOneYPosition 	;set the hieght (Y) up to 64 (based on image resolution)
	       ADD DX, bulletimgH 	;set the hieght (Y) up to 64 (based on image resolution)
		   mov DI, offset bulletimg  ; to iterate over the pixels
	       jmp StartBullet    	;Avoid drawing before the calculations
	DrawitBullet:
	       MOV AH,0Ch   	;set the configuration to writing a pixel
           cmp clearbulletone,1
           JNZ currentcolor 
           mov al, bgrndcolor        ; color of Background
           MOV BH,00h   	;set the page number
	       INT 10h      	;execute the configuration
           jmp StartBullet
    currentcolor: mov al, [DI]      ; color of the current coordinates 
	       MOV BH,00h   	;set the page number
	       INT 10h      	;execute the configuration
	StartBullet: 
		   inc DI
	       DEC Cx       	;  loop iteration in x direction
	       cmp Cx,bulletOneXPosition         ;JNZ Drawit      	;  check if we can draw c urrent x and y and excape the y iteration
	       JNZ DrawitBullet
           ADD Cx, bulletimgW 	;  if loop iteration in y direction, then x should start over so that we sweep the grid
	       DEC DX       	;  loop iteration in y direction
	       cmp DX,bulletOneYPosition
           JZ  ENDINGBullet   	;  both x and y reached 00 so end program
		   Jmp DrawitBullet

	ENDINGBullet:
	RET
DrawPlayerOneBullet ENDP

DrawPlayerOne PROC 
	       ;mov ax, 4F02h    ;
	       ;mov bx, 0100h    ; 640x400 screen graphics mode
	       ;INT 10h      	;execute the configuration
	       MOV AH,0Bh   	;set the configuration
	       MOV CX, Xposition  	;set the start drawing point 
	       ADD CX, imgW  	;set the width (X) up to 64 (based on image resolution)
	       MOV DX, Yposition 	;set the hieght (Y) up to 64 (based on image resolution)
	       ADD DX, imgH 	;set the hieght (Y) up to 64 (based on image resolution)
		   mov DI, offset img  ; to iterate over the pixels
	       jmp Start    	;Avoid drawing before the calculations
	Drawit:
	       MOV AH,0Ch   	;set the configuration to writing a pixel
           mov al, [DI]     ; color of the current coordinates
	       MOV BH,00h   	;set the page number
	       INT 10h      	;execute the configuration
	Start: 
		   inc DI
	       DEC Cx       	;  loop iteration in x direction
	       cmp Cx,Xposition         ;JNZ Drawit      	;  check if we can draw c urrent x and y and excape the y iteration
	       JNZ Drawit
           ADD Cx, imgW 	;  if loop iteration in y direction, then x should start over so that we sweep the grid
	       DEC DX       	;  loop iteration in y direction
	       cmp DX,Yposition
           JZ  ENDING   	;  both x and y reached 00 so end program
		   Jmp Drawit

	ENDING:
	RET
DrawPlayerOne ENDP

DrawPlayerTwo PROC 
	       ;mov ax, 4F02h    ;
	       ;mov bx, 0100h    ; 640x400 screen graphics mode
	       ;INT 10h      	;execute the configuration
	       MOV AH,0Bh   	;set the configuration
	       MOV CX, XptwoPosition  	;set the start drawing point 
	       ADD CX, imgW2  	;set the width (X) up to 64 (based on image resolution)
	       MOV DX, YptwoPosition 	;set the hieght (Y) up to 64 (based on image resolution)
	       ADD DX, imgH 	;set the hieght (Y) up to 64 (based on image resolution)
		   mov DI, offset imgTwo  ; to iterate over the pixels
	       jmp StartTwo    	;Avoid drawing before the calculations
	DrawitTwo:
	       MOV AH,0Ch   	;set the configuration to writing a pixel
           mov al, [DI]     ; color of the current coordinates
	       MOV BH,00h   	;set the page number
	       INT 10h      	;execute the configuration
	StartTwo: 
		   inc DI
	       DEC Cx       	;  loop iteration in x direction
	       cmp Cx,XptwoPosition         ;JNZ Drawit      	;  check if we can draw c urrent x and y and excape the y iteration
	       JNZ DrawitTwo
           ADD Cx, imgW2 	;  if loop iteration in y direction, then x should start over so that we sweep the grid
	       DEC DX       	;  loop iteration in y direction
	       cmp DX,YptwoPosition
	       JZ  ENDINGTwo   	;  both x and y reached 00 so end program
		   Jmp DrawitTwo

	ENDINGTwo:
    RET
DrawPlayerTwo ENDP

DrawPlayerTwoBullet PROC 
	       ;mov ax, 4F02h    ;
	       ;mov bx, 0100h    ; 640x400 screen graphics mode
	       ;INT 10h      	;execute the configuration
	       MOV AH,0Bh   	;set the configuration
	       MOV CX, bulletTwoXPosition  	;set the start drawing point 
	       ADD CX, bulletimgW  	;set the width (X) up to 64 (based on image resolution)
	       MOV DX, bulletOneYPosition 	;set the hieght (Y) up to 64 (based on image resolution)
	       ADD DX, bulletimgH 	;set the hieght (Y) up to 64 (based on image resolution)
		   mov DI, offset bulletimg2  ; to iterate over the pixels
	       jmp StartBullet2    	;Avoid drawing before the calculations
	DrawitBullet2:
	       MOV AH,0Ch   	;set the configuration to writing a pixel
           cmp clearbulletone,1
           JNZ currentcolor2 
           mov al, bgrndcolor        ; color of Background
           MOV BH,00h   	;set the page number
	       INT 10h      	;execute the configuration
           jmp StartBullet2
    currentcolor2: mov al, [DI]      ; color of the current coordinates 
	       MOV BH,00h   	;set the page number
	       INT 10h      	;execute the configuration
	StartBullet2: 
		   inc DI
	       DEC Cx       	;  loop iteration in x direction
	       cmp Cx,bulletTwoXPosition         ;JNZ Drawit      	;  check if we can draw c urrent x and y and excape the y iteration
	       JNZ DrawitBullet2
           ADD Cx, bulletimgW 	;  if loop iteration in y direction, then x should start over so that we sweep the grid
	       DEC DX       	;  loop iteration in y direction
	       cmp DX,bulletOneYPosition
           JZ  ENDINGBullet2   	;  both x and y reached 00 so end program
		   Jmp DrawitBullet2

	ENDINGBullet2:
	RET
DrawPlayerTwoBullet ENDP


